import React from 'react'
import { Label } from 'semantic-ui-react'

function LargeLabel({content}) {
  return (
    <div>
      <Label size = 'massive' style = {{fontSize: '2vw', textAlign: 'center', width: '100%', marginBottom: '4%'}}>
        {content}
      </Label>
    </div>
  )
}

export default LargeLabel
